script: |
  super -f text -I q11180.spq | sort > q11180.out

inputs:
  - name: q11180.spq
    data: |
      SELECT ALL - - col1 AS col2 FROM tab2 (FORMAT parquet) WHERE NULL NOT BETWEEN - 80 * + 38 + 27 + + 70 + - col1 * - ( - + 23 ) AND - 74;
  - name: tab2

outputs:
  - name: q11180.out
    data: |
